import React from 'react'
import styled from 'styled-components'


const Card = styled.div`
background:yellow;
display:flex;
width:100%;
height:45rem;
align-items:center;
justify-content:center;
`;

function CarCard() {
  return (
    <Card>CarCard</Card>
  )
}

export default CarCard
